That day cell will get the DayPicker-Day--selected CSS class.Clearing the selected dayWhen a selected day is clicked again, we want to clear it. This can be made setting the component's selectedDay to undefined (or null).The onDayClick handler receives as second argument an object that can be inspected to check if the clicked day has been selected or not:handleDayClick = (day, { selected }) => {
