The selectedDays and disabledDays prop can accept different value types to give you more flexibility about which days should appear selected or disabled.Preventing the user to select a disabled dayThis change still does not prevent the user to select a disabled day. Thus, we need our component to not update its state if the clicked day is disabled.In the click handler we can use the second argument to check if the clicked day is disabled, and prevent its selection:- handleDayClick = (day, { selected }) => {
+ handleDayClick = (day, { selected, disabled }) => {
